  \"Flyway Habitat Management Unit Project report no. 1: Introduction to the Flyway
  Habitat Management Unit Project\",\n\t\"tracking_summary\": {\n\t\t\"total\": 10,\n\t\t\"recent\":
  1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\":
  \"2015-06-17T01:56:34.997655\",\n\t\"name\": \"flyway-habitat-management-unit-project-report-no-1-introduction-to-the-flyway-habitat-mana\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"To reduce uncertainties and provide improved
  program guidance, we divided the coterminous United States into 164 management units,
  developed sets of key information that indicate in quantitative term show much habitat
  and hunting space there is now in each unit and will be in the future or which represent
  objectives, and then compared representations of objectives with the habitat and
  hunting space information to determine where problems of meeting objectives are
  likely to be most critical. The results of these efforts are presented in a series
  of 11 initial reports. This is the first. It provides background on the project.
  It describes the basis for delineating the management units, gives a general overview
  of methods used to obtain information and develop representations of objectives,
  and describes the organization of the information in the succeeding reports.\",\n\t\"license_title\":
